select * from meeting_relay_swimmers where id between 313 and 332;


select mrr.id 
from meeting_relay_results mrr 
	join meeting_programs mp on mp.id = mrr.meeting_program_id 
	join meeting_events me on me.id = mp.meeting_event_id 
	join event_types et on et.id = me.event_type_id 
	join meeting_sessions ms on ms.id = me.meeting_session_id 
	join gender_types gt on gt.id = mp.gender_type_id 
	join category_types ct on ct.id = mp.category_type_id 
where et.code = 'S4X100SL' 
	and ms.meeting_id = 16102 
	and gt.code = 'F' 
	and ct.code = '120-159' 
	and mrr.relay_header = 'CSI NUOTO OBER FERRARI ASD' 
	and mrr.rank = 4;


select et.code, ct.code, t.name, mrr.* 
from meeting_relay_results mrr
	join meeting_programs mp on mp.id = mrr.meeting_program_id
	join meeting_events me on me.id = mp.meeting_event_id
	join meeting_sessions ms on ms.id = me.meeting_session_id
	join event_types et on et.id = me.event_type_id
    join category_types ct on ct.id = mp.category_type_id
	join teams t on t.id = mrr.team_id
where ms.meeting_id = 16102;


select et.code, ct.code, t.name, mrs.* 
from meeting_relay_swimmers mrs
	join meeting_relay_results mrr on mrr.id = mrs.meeting_relay_result_id
	join meeting_programs mp on mp.id = mrr.meeting_program_id
	join meeting_events me on me.id = mp.meeting_event_id
	join meeting_sessions ms on ms.id = me.meeting_session_id
	join event_types et on et.id = me.event_type_id
    join category_types ct on ct.id = mp.category_type_id
	join teams t on t.id = mrr.team_id
where ms.meeting_id = 16102 and mrr.team_id = 1;
